import React from 'react';

class NavBar extends React.Component{
    render(){
        return (
            <div className='navbar'>
                <h1>Sol</h1>
                <ul>
                    <li>About</li>
                    <li>Cool graph I can do with API data</li>
                    <li>Cool JS powered test</li>
                    <li>Cool music app</li>
                </ul>
            </div>
        )
    }
}

export default NavBar;
